                margin: 10px auto;
                width: 70%;
            }
            .tableheader {
                background-color: Darkblue;
                color: white;
                padding: 10px;
                text-align: left;
                /* font-size: large; */
                border-bottom-style: solid;
                border-bottom-color: darkgray;
            }
            td {
                background-color: white;
                border-bottom: 1px;
                border-bottom-style: solid;
                border-bottom-color: #404040;
            }

            span {
                color: black;
            }

            .td1 {
                background-color: #F0F0F0;
            }
        </style>
    </head>
    <body>
        <div class='mainhead'>
            <img style='vertical-align: middle;' src='data:image/jpeg;base64,
' alt='Disk Usage' width='50' height='80'/>
            Maintenance Windows and Duration
        </div>
        <br>
        <div><i><center><b>Generated on: </b> $((Get-Date).DateTime)</center></i></div>
        $newHtmlFragment
